import image from './images/linkedIn-logo.png';
import './App.css';
import ComponentsList from "./Components/ComponentsLists";
import HomeScreen from './Components/ChildComponents/HomeScreen';
import { BrowserRouter,Routes,Route } from "react-router-dom";
import { useNavigate } from "react-router";

import { Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Link to="/">
          <img src={image} className="App-logo" alt="Home" />
        </Link>
      </header>

      <Routes>
        <Route path="/" element={<HomeScreen />} />
        <Route path="/other" element={<ComponentsList />} />
      </Routes>
    </div>
  );
}

export default App;
